  return (
    <div>
      <div style={{border: "solid 1px black",maxWidth:"100vw"}}>  

        <h1 className={"title red"}>Panda.com</h1>  

        <br/>  

        <img src={imageInSrc}/>

        <br/> 

        <img src={"imageInPublic.jpg"}/>  

      </div>  

      <player  width={320} height={240} controls>  

        <source src={"../myVideo.mp4"} type={"video/mp4"}/>

      </player>
    </div>
  );
}

export default App;
